","@import '../../theme/palette';
@import '../../theme/breakpoints';

.scheduler {
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 50px 4%;
    user-select: none;
    min-height: 100vh;

    & main {
        width: 100%;
        max-width: 950px;
        height: 100%;
        padding: 50px 85px;
        background-color: var(--paletteColor4);
        border-radius: 10px;
        box-shadow: 6px 6px 14px var(--rgbaColor2);

        & header {
            display: flex;
            justify-content: space-between;
            margin-bottom: 45px;

            & h1 {
                font-size: 32px;
                font-weight: 700;
                color: var(--paletteColor5);
            }

            & input {
                width: 215px;
                height: 42px !important;
                background-image: url('../../theme/assets/search-icon.svg');
                background-repeat: no-repeat;
                background-size: 18px 18px;
                background-position: 95% 50%;
            }
        }

        & input {
            -webkit-appearance: none; /*        (   height)... */
            height: 42px;
            min-width: 215px;
            padding: 0 14px;
            caret-color: var(--paletteColor3);
            border-radius: 5px;
            border: 1px solid var(--paletteColor6);
            outline: none;
            transition: border-color 0.1s ease-in-out;
            background-color: var(--paletteColor2);
            font-size: 20px;

            &::placeholder {
                font-size: 20px;
                transition: color 0.1s ease-in-out;
                color: var(--paletteColor6);
            }

            &:focus {
                border-color: var(--paletteColor3);

                &::placeholder {
                    color: transparent;
                }
            }
        }

        & section {
            margin-bottom: 31px;

            & form {
                display: flex;
                justify-content: space-between;
                margin: 0 0 13px;

                & input[type='text'] {
                    width: 100%;
                    margin-right: 22px;
                }

                & button {
                    min-width: 215px;
                    height: 42px;
                    border-radius: 5px;
                    background-color: var(--paletteColor3);
                    font-size: 18px;
                    padding-left: 25px;
                    color: var(--paletteColor2);
                    border: 0;
                    cursor: pointer;
                    background-image: url('../../theme/assets/plus-icon.svg');
                    background-repeat: no-repeat;
